## 2 The model

Throughout this article, $\left(r_{t}\right)_{t \geq 0}$ and $\left(q_{t}\right)_{t \geq 0}$ denote the interest rate and the dividend yield curves, respectively, and are assumed deterministic. The dividend yield includes the repo rate. We recall the 4 -factor path-dependent volatility (4FPDV) model of Guyon and Lekeufack (2023). The price $\left(S_{t}\right)_{t \geq 0}$ of the asset is modeled under the unique risk-neutral

probability measure $\mathbb{Q}$ by

$$
\mathrm{d} S_{t}=\left(r_{t}-q_{t}\right) S_{t} \mathrm{~d} t+S_{t} \sigma_{t} \mathrm{~d} W_{t}
$$

where $S_{0}>0, \sigma=\left(\sigma_{t}\right)_{t \geq 0}$ is the instantaneous volatility process to be specified, and $W=\left(W_{t}\right)_{t \geq 0}$ is a standard one-dimensional $\mathbb{Q}$-Brownian motion. The volatility is pathdependent and takes the following simple explicit form as a function of past returns:

$$
\begin{aligned}
\sigma_{t} & :=\sigma\left(R_{1, t}, R_{2, t}\right) \\
\sigma\left(R_{1}, R_{2}\right) & :=\beta_{0}+\beta_{1} R_{1}+\beta_{2} \sqrt{R_{2}}+\beta_{1,2} R_{1}^{2} \mathbf{1}_{\left\{R_{1}>0\right\}} \\
R_{1, t} & :=\left(1-\theta_{1}\right) R_{1,0, t}+\theta_{1} R_{1,1, t} \\
R_{2, t} & :=\left(1-\theta_{2}\right) R_{2,0, t}+\theta_{2} R_{2,1, t}
\end{aligned}
$$

where $R_{1,0, t}, R_{1,1, t}, R_{2,0, t}, R_{2,1, t}$ are four path-dependent factors defined by ${ }^{1}$

$$
R_{n, p, t}=\int_{-\infty}^{t} \lambda_{n, p} e^{-\lambda_{n, p}(t-u)}\left(\frac{\mathrm{d} S_{n}}{S_{n}}\right)^{n}, \quad n \in\{1,2\}, \quad p \in\{0,1\}
$$

The two factors $R_{1, p, t}$ are exponentially weighted moving averages of past returns, measuring the recent trend in the asset price, while the two factors $R_{2, p, t}$ are exponentially weighted moving averages of past squared returns, measuring the recent volatility in the asset price, with exponential weights $\lambda_{n, p}>0$. Note that

$$
R_{n, t}=\int_{-\infty}^{t} K_{n}(t-u)\left(\frac{\mathrm{d} S_{n}}{S_{n}}\right)^{n}, \quad n \in\{1,2\}
$$

is a weighted average of past returns (when $n=1$ ) or past squared returns (when $n=2$ ), where the convolution kernels

$$
K_{n}(t):=\left(1-\theta_{n}\right) \lambda_{n, 0} e^{-\lambda_{n, 0} t}+\theta_{n} \lambda_{n, 1} e^{-\lambda_{n, 1} t}
$$

are convex combinations of two exponential kernels. We use the convention that $\lambda_{n, 0} \geq \lambda_{n, 1}$, only for interpretation purposes, so $\lambda_{n, 0}$ codes for the short memory and $\lambda_{n, 1}$ for the long memory. This parametrization of the kernels allows us to
(i) mix short memory (large $\lambda_{n, 0}$ ) and long memory (smaller $\lambda_{n, 1}$ )-in particular, such kernels are well approximated by power laws over a large range of maturities;
(ii) build a Markovian model, since

$$
\begin{aligned}
& \mathrm{d} R_{1, p, t}=-\lambda_{1, p} R_{1, p, t} \mathrm{~d} t+\lambda_{1, p} \sigma\left(R_{1, t}, R_{2, t}\right) \mathrm{d} W_{t} \\
& \mathrm{~d} R_{2, p, t}=\lambda_{2, p}\left(\sigma\left(R_{1, t}, R_{2, t}\right)^{2}-R_{2, p, t}\right) \mathrm{d} t
\end{aligned}
$$

Nutz and Riveros Valdevenito (2024) have established the strong existence and uniqueness of a solution $\left(R_{1,0, t}, R_{1,1, t}, R_{2,0, t}, R_{2,1, t}\right)$ of the above SDE, hence the wellposedness of the 4FPDV model, when $\beta_{1,2}=0$. Andrès and Jourdain (2024) have extended this result to the case of generic kernels. In particular, the instantaneous volatility cannot blow up in finite time.

The parameters have the following interpretation:

