- $\lambda_{1,0}$ captures the dependence of $R_{1}$ on recent returns; the larger $\lambda_{1,0}$, the more weight is given to recent returns;
- $\lambda_{1,1}<\lambda_{1,0}$ captures the dependence of $R_{1}$ on older returns; the smaller $\lambda_{1,1}$, the more weight is given to old returns;
- $\lambda_{2,0}$ captures the dependence of $R_{2}$ on recent squared returns; the larger $\lambda_{2,0}$, the more weight is given to recent squared returns;
- $\lambda_{2,1}<\lambda_{2,0}$ captures the dependence of $R_{2}$ on older squared returns; the smaller $\lambda_{2,1}$, the more weight is given to old squared returns;
- $\theta_{1} \in[0,1]$ (resp., $\left.\theta_{2} \in[0,1]\right)$ mixes the dependence on recent and older returns (resp., squared returns) to form the summary variable $R_{1}$ (resp., $R_{2}$ );
- $\beta_{0}>0$ is the baseline instantaneous volatility;
- $\beta_{1}<0$ and $\beta_{2}>0$ are the sensitivities of the volatility to the trend $R_{1}$ and the historical volatility $\sqrt{R_{2}}$, respectively;
- $\beta_{1,2} \geq 0$ is an additional parameter which produces volatility when the asset price trends up-see below.

The role of $\beta_{1,2}$, The original 4FPDV model, which aimed to explain a single global level of implied volatility (e.g., the VIX) using past daily returns, has $\beta_{1,2}=0$. As explained in Guyon and Lekeufack (2023), allowing $\beta_{1,2}$ to vary did not significantly increase the predictive power of the model. However, the continuous-time limit of the original 4FPDV model, that is, Model (2.2) with $\beta_{1,2}=0$, generates out-the-money (OTM) call implied volatilities that are too small and do not increase with strike for large strikes. In order for the continuous-time model to fit not only one single global level of implied volatility but full smiles of implied volatility, Guyon and Lekeufack (2023) added the term $\beta_{1,2} R_{1}^{2} \mathbf{1}_{\left\{R_{1}>0\right\}}$, with $\beta_{1,2} \geq 0$. Indeed, compared to the case where $\beta_{1,2}=0$, this term generates added volatility when the asset price experiences a positive trend. This allows the asset price to take large values with higher probability, and this results in increased risk-neutral density for large asset price values, therefore increased implied volatility for large strikes.

