The dynamics of the instantaneous volatility in model (2.2) is given by the following lemma. For ease of notation, we denote $R_{t}:=\left(R_{1,0, t}, R_{1,1, t}, R_{2,0, t}, R_{2,1, t}\right)$ and introduce the following quantities:

$$
\bar{\lambda}_{n}:=\left(1-\theta_{n}\right) \lambda_{n, 0}+\theta_{n} \lambda_{n, 1}, \quad \bar{R}_{n, t}:=\frac{\left(1-\theta_{n}\right) \lambda_{n, 0} R_{n, 0, t}+\theta_{n} \lambda_{n, 1} R_{n, 1, t}}{\bar{\lambda}_{n}}, \quad n \in\{1,2\}
$$

Lemma 2.1. Let $\sigma=\left(\sigma_{t}\right)_{t \geq 0}$ satisfy (2.2). Then

$$
\mathrm{d} \sigma_{t}=\mu\left(R_{t}\right) \mathrm{d} t+\nu\left(R_{t}\right) \mathrm{d} W_{t}
$$

where

$$
\begin{aligned}
& \mu\left(R_{t}\right)=-\left(\beta_{1}+2 \beta_{1,2} R_{1, t} \mathbf{1}_{\left\{R_{1, t}>0\right\}}\right) \bar{\lambda}_{1} \bar{R}_{1, t}+\beta_{2} \bar{\lambda}_{2} \frac{\left(\sigma_{t}^{2}-\bar{R}_{2, t}\right)}{2 \sqrt{R_{2, t}}}+\beta_{1,2} \bar{\lambda}_{1}^{2} \sigma_{t}^{2} \\
& \nu\left(R_{t}\right)=\left(\beta_{1}+2 \beta_{1,2} R_{1, t} \mathbf{1}_{\left\{R_{1, t}>0\right\}}\right) \bar{\lambda}_{1} \sigma_{t}
\end{aligned}
$$

Proof. The proof is a straightforward application of Itô's formula.
When $\beta_{1,2}=0$, the instantaneous (lognormal) volatility of the instantaneous volatility is constant (equal to $\left|\beta_{1}\right| \bar{\lambda}_{1}$ ), like in Bergomi models. When $\beta_{1,2}>0$, it is equal to $\left|\left(\beta_{1}+2 \beta_{1,2} R_{1, t} \mathbf{1}_{\left\{R_{1, t}>0\right\}}\right)\right| \bar{\lambda}_{1}$ and thus depends on the trend $R_{1, t}$. It vanishes when $R_{1, t}=-\frac{\beta_{1}}{2 \beta_{1,2}}>0$, and can get large when the asset price trends very positively. In the numerical experiments, to avoid a possible explosion of the instantaneous volatility caused by the superlinear term $R_{1}^{2}$, the instantaneous volatility $\sigma$ is capped at 1.5 .

Remark 2.2. Let us stress that in classical stochastic volatility models, the initial values of the instantaneous volatility or of the latent volatility factors, e.g., Ornstein-Uhlenbeck factors, are not observable and thus have to be calibrated, like model parameters. The same holds for Markovian approximations of rough volatility models, e.g., Rosenbaum and Zhang (2022). By contrast, in pure PDV models, the factors driving the instantaneous volatility are observable in the market - in the case of the 4 FPDV model, weighted averages of past returns and past squared returns. The model parameters thus directly yield the initial values of the factors, which do not need to be calibrated.
